import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { CrmRoutingModule } from '../crm-routing/crm-routing.module';
import { ViewEnquiryComponent } from 'src/app/crm/view-enquiry/view-enquiry.component';
import { ReqcibilComponent } from 'src/app/crm/reqcibil/reqcibil.component';
import { ApplyloanComponent } from 'src/app/crm/applyloan/applyloan.component';


console.log('In crm Module');

@NgModule({
  declarations: [
    ViewEnquiryComponent,
    ReqcibilComponent,
    ApplyloanComponent
  ],

  imports: 
  [
    CommonModule,
    crmRoutingModule
  ]
})
export class CrmModule { }
